import React, { useEffect, useState } from 'react';
import axios from 'axios';

function App() {
  const [data, setData] = useState([]);

  useEffect(() => {
    // Gửi yêu cầu lấy dữ liệu từ backend khi component được tải
    axios.get('http://localhost:5000/api/data')
      .then(response => {
        setData(response.data);
      })
      .catch(error => {
        console.error('Error fetching data:', error);
      });
  }, []);

  return (
    <div>
      <h1>Sample Web App with ReactJs and NodeJs</h1>
      <ul>
        {data.map(item => (
          <li key={item.id}>
            {item.column1}: {item.column2} {/* Thay column1, column2 bằng các trường trong dữ liệu của bạn */}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default App;
